                    { 5, "With You", "China", "upload/MovieSingle/MyBestSummer/Cover_MyBestSummer.jpg", null, new DateTime(2024, 4, 1, 0, 0, 0, 0, DateTimeKind.Unspecified), null, "The story of Canh Canh and Du Hoai, two high school students who reluctantly became friends because of their names, spending 3 years of high school together. In the movie Ha Lam Dau plays the female lead Canh Canh, a \"study student\", although her academic performance is not good but she always tries to strive. Ha Lam Dau with mushroom hair in a loose white and blue uniform and a lovely face, very suitable for the character's image. Makes viewers feel like they're being transported back to their own student days.", null, "Chinese", "My Best Summer", 2019, "my-best-summer", 2, 110, "upload/MovieSingle/MyBestSummer/My_Best_Summer_Trailer480p.mp4", null, null },
